import React, { useState, useEffect } from "react";
import axios from "axios";

const TableComponent = () => {
  //const [records, setRecords] = useState([]);
  const [ongoingCompressions, setOngoingCompressions] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchOngoingCompressions = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.get(
        "http://localhost:5000/ongoing-compressions"
      );
      setOngoingCompressions(response.data);
    } catch (error) {
      setError("Error fetching ongoing compressions");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchOngoingCompressions();
  }, []);

  return (
    <div>
      <h1>Ongoing Compressions</h1>
      {loading && <p>Loading...</p>}
      {error && <p>{error}</p>}
      {ongoingCompressions && (
        <table>
          <thead>
            <tr>
              <th>File Name</th>
              <th>Status</th>
              <th>Start Time</th>
              <th>End Time</th>
              <th>Details</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(ongoingCompressions).map(
              ([fileName, compression]) => (
                <tr key={fileName}>
                  <td>{fileName}</td>
                  <td>{compression.status}</td>
                  <td>{compression.startTime}</td>
                  <td>{compression.endTime || "N/A"}</td>
                  <td>{compression.error || "N/A"}</td>
                </tr>
              )
            )}
          </tbody>
        </table>
      )}
    </div>
  );
};
export default TableComponent;
